	    return self.m_nodes[#self.m_nodes - 1]
	end

	---@return Freemaker.file-system.path
	function path:normalize()
	    ---@type string[]
	    local newNodes = {}

	    for index, value in ipairs(self.m_nodes) do
	        if value == "." then
