	            if index == 1 or index == #self.m_nodes then
	                newNodes[#newNodes + 1] = ""
	            end
	        elseif value == ".." then
	            if index ~= 1 then
	                newNodes[#newNodes] = nil
	            end
	        else
	            newNodes[#newNodes + 1] = value
	        end
	    end

	    if newNodes[1] then
	        newNodes[1] = newNodes[1]:gsub("@", "")
	    end

	    self.m_nodes = newNodes
	    return self
